import {Box,Text,Image,Stack,Heading} from '@chakra-ui/react';

function MidPart2(){
    return(
        <Box border='1px solid teal'>
            <Box marginTop="50px">
                <Heading fontWeight='normal' color="#666666" text>Introducing The World's 1st Meat-Free Lifestyle Platform</Heading>
            </Box>
        </Box>
    )
}

export default MidPart2;
